import Home from "./pages/Home";
import Create from "./pages/Create";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {
  return (
    <>
      <Router>
        <div>
          <Route path="/"></Route>
          <Route path="/create">
            <Create />
          </Route>
        </div>
      </Router>
    </>
  );
}

export default App;
